import React, { useState, useEffect } from 'react';
import { useParams, Link } from 'react-router-dom';

function UserSubmissions({ token }) {
  const { userId } = useParams();
  const [allSubmissions, setAllSubmissions] = useState([]); // Store all fetched submissions
  const [submissions, setSubmissions] = useState([]); // Submissions to display after filtering
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [filterProblemId, setFilterProblemId] = useState('');
  const [filterStatus, setFilterStatus] = useState('');
  const [filterLanguage, setFilterLanguage] = useState('');
  const [filterStartDate, setFilterStartDate] = useState('');
  const [filterEndDate, setFilterEndDate] = useState('');

  useEffect(() => {
    const fetchSubmissions = async () => {
      try {
        const response = await fetch(`http://localhost:5000/api/users/${userId}/submissions`, {
          headers: {
            'Authorization': `Bearer ${token}`
          }
        });
        if (!response.ok) {
          throw new Error(`HTTP error! status: ${response.status}`);
        }
        const data = await response.json();
        setAllSubmissions(data); // Store all submissions
        setSubmissions(data);    // Initially display all submissions
      } catch (error) {
        setError(error);
      } finally {
        setLoading(false);
      }
    };

    if (userId && token) {
      fetchSubmissions();
    }
  }, [userId, token]);

  useEffect(() => {
    let filtered = allSubmissions;

    if (filterProblemId) {
      filtered = filtered.filter(submission =>
        submission.problem_id.toLowerCase().includes(filterProblemId.toLowerCase())
      );
    }

    if (filterStatus) {
      filtered = filtered.filter(submission =>
        submission.status.toLowerCase() === filterStatus.toLowerCase()
      );
    }

    if (filterLanguage) {
      filtered = filtered.filter(submission =>
        submission.language.toLowerCase() === filterLanguage.toLowerCase()
      );
    }

    if (filterStartDate) {
      const start = new Date(filterStartDate).getTime();
      filtered = filtered.filter(submission =>
        new Date(submission.timestamp).getTime() >= start
      );
    }

    if (filterEndDate) {
      const end = new Date(filterEndDate).getTime();
      // To include the entire end day, set the time to the end of the day (23:59:59.999)
      const endDateAdjusted = new Date(filterEndDate);
      endDateAdjusted.setHours(23, 59, 59, 999);
      const endTimestamp = endDateAdjusted.getTime();

      filtered = filtered.filter(submission =>
        new Date(submission.timestamp).getTime() <= endTimestamp
      );
    }

    setSubmissions(filtered);
  }, [allSubmissions, filterProblemId, filterStatus, filterLanguage, filterStartDate, filterEndDate]);

  if (loading) {
    return (
      <div className="flex items-center justify-center min-h-screen bg-gray-100 dark:bg-gray-900">
        <div className="text-xl font-semibold text-gray-700 dark:text-gray-300">Loading submissions...</div>
      </div>
    );
  }

  if (error) {
    return (
      <div className="flex items-center justify-center min-h-screen bg-red-100 dark:bg-red-900 text-red-800 dark:text-red-200">
        Error: {error.message}
      </div>
    );
  }

  // Extract unique statuses and languages for filter options
  const uniqueStatuses = [...new Set(allSubmissions.map(s => s.status))];
  const uniqueLanguages = [...new Set(allSubmissions.map(s => s.language))];

  return (
    <div className="min-h-screen bg-gray-100 dark:bg-gray-900 text-gray-900 dark:text-gray-100 p-4 sm:p-6 lg:p-8 font-sans">
      <div className="max-w-7xl mx-auto">
        <h1 className="text-3xl sm:text-4xl font-extrabold mb-8 text-center text-blue-700 dark:text-blue-400">
          Submissions for User: {userId}
        </h1>

        {/* Filter Section */}
        <div className="bg-white dark:bg-gray-800 rounded-lg shadow-lg p-6 mb-8">
          <h3 className="text-xl font-semibold mb-4 text-gray-800 dark:text-gray-200">Filter Submissions</h3>
          <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 xl:grid-cols-5 gap-4">
            {/* Problem ID Filter */}
            <div className="flex flex-col">
              <label htmlFor="problemId" className="text-sm font-medium text-gray-700 dark:text-gray-300 mb-1">Problem ID</label>
              <input
                type="text"
                id="problemId"
                className="p-2 border border-gray-300 dark:border-gray-600 rounded-md focus:ring-blue-500 focus:border-blue-500 dark:bg-gray-700 dark:text-gray-100"
                placeholder="e.g., TwoSum"
                value={filterProblemId}
                onChange={(e) => setFilterProblemId(e.target.value)}
              />
            </div>

            {/* Status Filter */}
            <div className="flex flex-col">
              <label htmlFor="status" className="text-sm font-medium text-gray-700 dark:text-gray-300 mb-1">Status</label>
              <select
                id="status"
                className="p-2 border border-gray-300 dark:border-gray-600 rounded-md focus:ring-blue-500 focus:border-blue-500 dark:bg-gray-700 dark:text-gray-100"
                value={filterStatus}
                onChange={(e) => setFilterStatus(e.target.value)}
              >
                <option value="">All Statuses</option>
                {uniqueStatuses.map(status => (
                  <option key={status} value={status}>{status}</option>
                ))}
              </select>
            </div>

            {/* Language Filter */}
            <div className="flex flex-col">
              <label htmlFor="language" className="text-sm font-medium text-gray-700 dark:text-gray-300 mb-1">Language</label>
              <select
                id="language"
                className="p-2 border border-gray-300 dark:border-gray-600 rounded-md focus:ring-blue-500 focus:border-blue-500 dark:bg-gray-700 dark:text-gray-100"
                value={filterLanguage}
                onChange={(e) => setFilterLanguage(e.target.value)}
              >
                <option value="">All Languages</option>
                {uniqueLanguages.map(lang => (
                  <option key={lang} value={lang}>{lang}</option>
                ))}
              </select>
            </div>

            {/* Start Date Filter */}
            <div className="flex flex-col">
              <label htmlFor="startDate" className="text-sm font-medium text-gray-700 dark:text-gray-300 mb-1">Start Date</label>
              <input
                type="date"
                id="startDate"
                className="p-2 border border-gray-300 dark:border-gray-600 rounded-md focus:ring-blue-500 focus:border-blue-500 dark:bg-gray-700 dark:text-gray-100"
                value={filterStartDate}
                onChange={(e) => setFilterStartDate(e.target.value)}
              />
            </div>

            {/* End Date Filter */}
            <div className="flex flex-col">
              <label htmlFor="endDate" className="text-sm font-medium text-gray-700 dark:text-gray-300 mb-1">End Date</label>
              <input
                type="date"
                id="endDate"
                className="p-2 border border-gray-300 dark:border-gray-600 rounded-md focus:ring-blue-500 focus:border-blue-500 dark:bg-gray-700 dark:text-gray-100"
                value={filterEndDate}
                onChange={(e) => setFilterEndDate(e.target.value)}
              />
            </div>
          </div>
        </div>

        {/* Submissions List */}
        {submissions.length === 0 ? (
          <div className="bg-white dark:bg-gray-800 rounded-lg shadow-lg p-6 text-center text-gray-600 dark:text-gray-400">
            No submissions found matching your filters.
          </div>
        ) : (
          <ul className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
            {submissions.map(submission => (
              <li key={submission.submission_id} className="bg-white dark:bg-gray-800 rounded-lg shadow-md hover:shadow-xl transition-shadow duration-300">
                <Link to={`/submissions/${submission.submission_id}`} className="block p-6 text-inherit no-underline">
                  <p className="text-lg font-bold text-blue-600 dark:text-blue-300 mb-2">Submission ID: {submission.submission_id}</p>
                  <p className="text-md text-gray-800 dark:text-gray-200 mb-1">
                    <strong className="font-semibold">Problem ID:</strong> {submission.problem_id}
                  </p>
                  <p className={`text-md font-semibold mb-1 ${
                    submission.status === 'Accepted' ? 'text-green-600 dark:text-green-400' :
                    submission.status === 'Wrong Answer' ? 'text-red-600 dark:text-red-400' :
                    submission.status === 'Time Limit Exceeded' ? 'text-yellow-600 dark:text-yellow-400' :
                    'text-gray-600 dark:text-gray-400'
                  }`}>
                    Status: {submission.status}
                  </p>
                  <p className="text-md text-gray-700 dark:text-gray-300 mb-1">
                    <strong className="font-semibold">Language:</strong> {submission.language}
                  </p>
                  <p className="text-sm text-gray-500 dark:text-gray-400 mb-2">
                    <strong className="font-semibold">Timestamp:</strong> {new Date(submission.timestamp).toLocaleString()}
                  </p>
                  {submission.test_results && (
                    <p className="text-md text-gray-700 dark:text-gray-300">
                      <strong className="font-semibold">Test Results:</strong>
                      {' '} {submission.test_results.filter(tr => tr.status === 'passed').length} / {submission.test_results.length} passed
                    </p>
                  )}
                </Link>
              </li>
            ))}
          </ul>
        )}
      </div>
    </div>
  );
}

export default UserSubmissions;
